    <style>
        * {
            padding: 0;
            margin: 0;
        }

        body {
            position: relative;
            font-family: "pretendard";
        }

        .logo1 {
            position: relative; width: 300px; height: 300px; text-align: center; background-color: #fff; box-shadow: 0px 5px 10px rgba(124, 124, 124, 0.25); box-sizing: border-box; overflow: hidden;
        }

        .logo1 svg {
            position: absolute; top: 50%; left: 50%; z-index: 1; transform: translate(-50%,-70%);
            margin: 0 auto;
        }
        .logo1 .wave {
            opacity: .4;
            position: absolute;
            top: 3%;
            left: 50%;
            background: #5CB531;
            width: 500px;
            height: 500px;
            margin-left: -250px;
            margin-top: -250px;
            transform-origin: 50% 48%;
            border-radius: 43%;
            animation: drift 3000ms infinite linear;
        }
        .wave.-three {
            animation: drift 5000ms infinite linear;
        }

        .wave.-two {
            animation: drift 7000ms infinite linear;
            opacity: ;
            background: #46A92A;
        }
        @keyframes drift {
            from { transform: rotate(0deg); }
            from { transform: rotate(360deg); }
        }
        
        .logo2{position: relative; margin-top: 100px; width: 300px; height: 300px; perspective: 330px; background-color: #4FAD35;}
        .logo2 svg {position: absolute; top: 50%; left: 50%; z-index: 1; transform: translate(-50%,-50%);}
        .cube {
            position: absolute;
            top: 50%;
            left: 50%;
            margin-top: -105px;
            margin-left: -105px;
            width: 210px;
            height: 210px;
            -webkit-transform-style: preserve-3d;
            -webkit-transform-origin: 105px 105px;
            animation: spinCube 9000ms linear infinite;
        }
        .cube .faces {
            position: absolute;
            top: 0px;
            left: 0px;
            width: 210px;
            height: 210px;
            /*animation: spinCube 4500ms linear infinite;*/
        }
      
      .dot {
            position: absolute;
            background: rgba(255, 255, 255, 1);
            width: 2px;
            height: 2px;
            border-radius: 50%;
      }
      .p1 {
        top: -1px;
        ;
        margin-left: -1px;
      }
      .p2 {
        top: -1px;
        ;
        left: 50%;
        margin-left: -1px;
      }
      .p3 {
        top: -1px;
        ;
        left: 100%;
        margin-left: -1px;
      }
      .p4 {
        top: 50%;
        left: -1px;
        margin-top: -1px;
      }
      .p5 {
        top: 50%;
        left: 50%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p6 {
        top: 50%;
        left: 100%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p7 {
        top: 100%;
        left: 0%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p8 {
        top: 100%;
        left: 50%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p9 {
        top: 100%;
        left: 100%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p10 {
        top: 25%;
        ;
        left: 25%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p11 {
        top: 25%;
        ;
        left: 75%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p12 {
        top: 75%;
        ;
        left: 25%;
        margin-top: -1px;
        margin-left: -1px;
      }
      .p13 {
        top: 75%;
        ;
        left: 75%;
        margin-top: -1px;
        margin-left: -1px;
      }
    .f1 {
      -webkit-transform: translateZ(-105px);
      animation-delay: 0.3s;
    }
    .f2 {
      -webkit-transform: translateZ(-84px);
      animation-delay: 0.6s;
    }
    .f3 {
      -webkit-transform: translateZ(-63px);
      animation-delay: 0.9s;
    }
    .f4 {
      -webkit-transform: translateZ(-42px);
      animation-delay: 1.2s;
    }
    .f5 {
      -webkit-transform: translateZ(-21px);
      animation-delay: 1.5s;
    }
    .f6 {
      -webkit-transform: translateZ(0px);
      animation-delay: 1.8s;
    }
    .f7 {
      -webkit-transform: translateZ(21px);
      animation-delay: 2.1s;
    }
    .f8 {
      -webkit-transform: translateZ(42px);
      animation-delay: 2.4s;
    }
    .f9 {
      -webkit-transform: translateZ(63px);
      animation-delay: 2.7s;
    }
    .f10 {
      -webkit-transform: translateZ(84px);
      animation-delay: 3s;
    }
    .f11 {
      -webkit-transform: translateZ(105px);
      animation-delay: 3.3s;
    }

    @-webkit-keyframes spinCube {
      0% {
        -webkit-transform: rotateY(0deg) rotateX(-45deg) rotate(0deg);
      }
      50% {
        -webkit-transform: rotateY(180deg) rotateX(135deg) rotate(180deg);
      }
      100% {
        -webkit-transform: rotateY(360deg) rotateX(315deg) rotate(360deg);
      }
    }

    @-webkit-keyframes spinDots {
      0% {
        -webkit-transform: rotateX(0deg) rotateY(45deg);
      }
      50% {
        -webkit-transform: rotateX(-180deg) rotateY(-135deg);
      }
      100% {
        -webkit-transform: rotateX(-360deg) rotateY(-315deg);
      }
    }

    @-webkit-keyframes spinFaces {
      0% {
        -webkit-transform: rotateX(0deg);
      }
      50% {
        -webkit-transform: rotateX(180deg);
      }
      100% {
        -webkit-transform: rotateX(0deg);
      }
    }
        
        .logo3{position: relative; display: inline-block; margin-top: 100px;}
        .logo3 .particle {
            opacity:0;
            position: absolute;
            background-color:rgba(79, 173, 53,0.5);
            animation: bubbles 3s ease-in infinite;
            border-radius:100%;
         }
        @keyframes bubbles {
           0% {
              opacity: 0;
           }
           20% { 
              opacity: 1;
              transform:translate(0, -20%);
           }
           100% {
              opacity: 0;
              transform:translate(0, -1000%);
           }
        }
        
        .logo4{position: relative; display: inline-block; margin-left: 50px;}
        .logo4 .particle {
            opacity:0;
            position: absolute;
            animation: confetti 3s ease-in infinite;
        }
        @keyframes confetti {
           0% {
              opacity:0;
              transform:translateY(0%) rotate(0deg);
           }
           10% {
              opacity:1;
           }
           35% {
              transform:translateY(-1000%) rotate(270deg);
           }
           80% {
              opacity:1;
           }
           100% {
              opacity:0;
              transform:translateY(1000%) rotate(1440deg);
           }
        }
        .logo4 .particle.c1 {
           background-color:rgba(76,175,80,0.5);
        }
        .logo4 .particle.c2 {
           background-color:rgba(156,39,176,0.5);
        }
        
        .logo5{position: relative; display: inline-block; margin-left: 50px;}
        .logo5 svg{position: relative; z-index: 1;}
        .logo5 .particle {
            opacity:0;
            position: absolute;
            background-color:#9fe28d;
            animation: hearts 3s ease-in infinite;
        }
        .logo5 .particle:before, .logo5 .particle:after {
           position: absolute;
           content: '';
            z-index: 0;
           border-radius:100px;
           top:0px;
           left:0px;
           width:100%;
           height:100%;
           background-color:#9fe28d;
        }
        .logo5 .particle:before {
           transform:translateX(-50%);
        }
        .logo5 .particle:after {
           transform:translateY(-50%);
        }
        
        @keyframes hearts {
           0% {
              opacity: 0;
              transform:translate(0, 0%) rotate(45deg);
           }
           20% {
              opacity: 0.8;
              transform:translate(0, -20%) rotate(45deg);
           }
           100% {
              opacity: 0;
              transform:translate(0, -500%) rotate(45deg);
           }
        }
        .logo6{position: relative; display: inline-block; margin-left: 50px;transform: rotate(-10deg); overflow: hidden; background-color: #fff;}
        .logo6 svg:nth-child(1){transform: skew(10deg); background-color: #fff; overflow: hidden;}
        .logo6 svg:nth-child(2),
        .logo6 svg:nth-child(3){position: absolute; top: 0; left: 0;}
        .logo6 svg:nth-child(2){top: -44%; transform: skew(-13deg);}
        .logo6 svg:nth-child(3){top: 46%; transform: skew(13deg);}
    </style>
